import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "./css/styles.css"; // Adjust the path as necessary

import IdentityServer from "./is/IdentityServer";
import Asgardeo from "./asgardeo/Asgardeo";

function App() {
  const HomeComponent = () =>
    <div className="centered">
      <img src="./images/wso2-logo.webp" alt="Logo" width="100" />
      <h2>WSO2 Authentication Demo</h2>
      <Link className="mockbutton" to="/is/identityserver">
        Identity Server
      </Link>
      <Link className="mockbutton" to="/asgardeo/asgardeo">
        Asgardeo
      </Link>
    </div>;

  const Hi = () => {
    <div>Hello World</div>;
  };

  return (
    <Routes>
      <Router>
        {/* Define Route for Root Path */}
        {/* <Route exact path="/" component={HomeComponent} /> */}
        <Route exact path="/" component={Hi} />

        {/* Other Defined Routes */}
        <Route path="/is/identityserver" component={IdentityServer} />
        <Route path="/asgardeo/asgardeo" component={Asgardeo} />
      </Router>
    </Routes>
  );
}

export default App;
